import React from 'react'
import { withRouter } from 'react-router'



const Welcome = (props) => {

    const handleClick = (e) => {
        console.log("hi")
        return props.history.push('/login')

    }

    return(
        <>
            <button onClick={handleClick}>Login</button>
        </>
    )
}

export default (withRouter(Welcome))
